import org.apache.spark.SparkContext
import org.apache.spark.mllib.random.RandomRDDs._
import scala.util.Random

// Generate a random double RDD that contains 1 million i.i.d. values drawn from the
// uniform distribution `N(0.0, 1.0)`, evenly distributed in 10 partitions.
val u = uniformRDD(sc, 1000000L, 2)
//val uniformIds = u.collect()

// To transform the distribution in the generated RDD from `U(0.0, 1.0)` to `U(a, b)`, 
//  use uniformIds.map(v => a + (b - a) * v)`.
val v = u.map(id => (0 + 433 * id).toInt)
val ids = v.collect()

